/**
 * Search dream dictionary by keyword
 * Returns matching entries sorted by relevance
 */
export const searchDreamNumber = (query) => {
    if (!query || query.trim().length === 0) return [];

    const q = query.trim().toLowerCase();

    const results = DREAM_NUMBERS.filter(entry => {
        // Exact keyword match
        if (entry.keyword.toLowerCase().includes(q)) return true;
        // Alias match
        if (entry.aliases.some(a => a.toLowerCase().includes(q))) return true;
        return false;
    });

    // Sort: exact match first, then partial
    results.sort((a, b) => {
        const aExact = a.keyword.toLowerCase() === q ? 0 : 1;
        const bExact = b.keyword.toLowerCase() === q ? 0 : 1;
        return aExact - bExact;
    });

    return results;
};

